INSERT INTO `contracts_table` VALUES (1,'contract (3).rtf','contract','<table style=\"border-collapse: collapse; width: 100%; height: 2734px; border-spacing: 1px; border: 0px solid rgb(0, 0, 0); margin-left: 0px; margin-right: auto;\" border=\"1\"><colgroup><col style=\"width: 51.5244%;\"><col style=\"width: 48.5122%;\"></colgroup>\n<tbody>\n<tr>\n<td style=\"border-width: 0px; border-color: rgb(0, 0, 0); line-height: 1.1;\">\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">irianna_logo</span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-size: 10pt; font-family: arial, helvetica, sans-serif;\">Место <span style=\"font-weight: bold;\">resort_name</span> - <span style=\"font-weight: bold;\">hotel_name</span></span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-weight: bold; font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">ДОГОВОР ОКАЗАНИЯ ТУРИСТИЧЕСКИХ УСЛУГ</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">от day.month.year г.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">г.Минск</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">период с &shy;from_minsk_date до arrival_to_minsk</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">ОДО &laquo;ИриАнна&raquo;, именуемое в дальнейшем &laquo;Исполнитель&raquo;, в лице специалиста по туризму manager_name, действующего на основании Доверенности №Б/Н от &laquo;22&raquo; января 2023 г., с одной стороны, и client_name, именуемый(ая) в дальнейшем &laquo;Заказчик&raquo;, с другой стороны, заключили настоящий договор о нижеследующем:</span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">1. ПРЕДМЕТ ДОГОВОРА.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">1.1.Исполнитель оказывает Заказчику услуги по организации путешествия в объеме и на условиях, предусмотренных настоящим договором , ПРИЛОЖЕНИЕ №1 и ПРИЛОЖЕНИЕ №2 (которые является неотъемлемой частью настоящего договора).</span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.ОБЩИЕ УСЛОВИЯ.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.1.Описание маршрута путешествия и программа пребывания на конечном и промежуточном пунктах маршрута путешествия оформляются в виде приложений, которые являются неотъемлемой частью настоящего договора и включают в себя следующую обязательную информацию:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-дата, время начала и окончания путешествия, в том числе дата и место отправления и ориентировочное</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-время прибытия транспорта к месту проведения отдыха;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-порядок встречи, сопровождения и проводов туристов;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-вид, категория транспорта на всех этапах путешествия, включая трансфер;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-питание - вид;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-категория (вид) средства размещения, санитарные условия и количество спальных мест в помещениях с указанием расстояния до объектов цели путешествия, указанных в описании маршрута;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-количество, тема и продолжительность экскурсий, наличие гида-переводчика;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-дополнительные платные услуги, предоставляемые во время путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-меры предосторожности или условия безопасности, применение которых необходимо во время путешествия.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.2.Меры предосторожности или иные условия безопасности, которые обязан соблюдать Заказчик (или третьи лица, в пользу которых Заказчиком заключен настоящий договор), излагаются в приложении, которое подписывается Заказчиком, и является неотъемлемой частью настоящего договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.3.Исполнитель несет ответственность за достоверность только той информации, которая изложена в его рекламных материалах и приложениях к настоящему договору.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.4.Заказчик, заключивший настоящий договор в пользу третьих лиц, выражает тем самым их согласие на условия договора и доводит информацию по путешествию до сведения остальных лиц.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.5.Количество лиц,получающих услуги по настоящему договору со стороны Заказчика, составляет total_people человек, в том числе number_of_children детей в возрасте age_of_children лет</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.6.Заказчик предупрежден,что минимальное количество лиц в группе, необходимое для совершения путешествия по оговоренному маршруту, составляет 30 человек, что подтверждается его подписью на экземпляре договора, принадлежащем Исполнителю.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">2.7. Данный туристический продукт разработан и его организационное сопровождение осуществляется фирмой ОДО &laquo;ИриАнна&raquo;.</span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.ПРАВА И ОБЯЗАННОСТИ СТОРОН.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.1.Исполнитель обязан:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.1.1.письменно, с использованием фотографий, буклетов и других источников предоставить Заказчику исчерпывающие сведения обо всех условиях путешествия и провести необходимые инструктажи. Документ (приложение к &laquo;ДОГОВОРУ ОКАЗАНИЯ ТУРИСТИЧЕСКИХ УСЛУГ&raquo; - &laquo;приложение№2&raquo;), оформляемый в соответствии с настоящим пунктом, в обязательном порядке должен быть подписан Заказчиком.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.1.2. немедленно (в письменной форме или устно по телефону) предупредить Заказчика и приостановить работу до получения письменных или устных указаний Заказчика при обнаружении не зависящих от Исполнителя обстоятельств, которые грозят качеству результатов услуги либо создают невозможность ее оказания в срок.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.Исполнитель имеет право:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.1.требовать от Заказчика выполнения мер предосторожности и всех условий безопасности, которые обязан выполнять Заказчик во время путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.2. отменить путешествие или изменить дату и время начала путешествия в случае: отказа в подтверждении бронирования номеров, отсутствия достаточного количества лиц для формирования группы по оговоренному маршруту, известив об этом Заказчика не позднее, чем за 20 дней до его начала. При этом, в случае изменения даты и времени начала путешествия и отказа Заказчика от указанных изменений, Исполнитель возмещает ему внесенные средства на счет Заказчика. Аналогичным образом Заказчик возмещает расходы исполнителю в случае отмены путешествия Заказчиком. Возмещение расходов в соответствии с настоящим пунктом производится только на основании документального подтверждения;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.3.самостоятельно внести соответствующие изменения в экскурсионную программу Заказчика без изменения стоимости экскурсий и заменить отель (место проживания Заказчика) на равнозначный (равноценный);</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.4.отказать Заказчику в исполнении туристической услуги, без возмещении расходов в случае неадекватного поведения Заказчика.(алкогольное опьянение, нецензурная брань, неуважительное отношение к сотрудникам Исполнителя , клиентам агентства и т.д.)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.2.5. отказать Заказчику в удовлетворении требований о возмещении имущественного и (или) морального вреда в случае не выполнения последним условий, предусмотренных п. 3.4.9. настоящего договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.3. Заказчик имеет право:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.3.1. до начала путешествия получить информацию о правилах въезда и временного пребывания в стране (месте) путешествия, об обычаях местного населения, в том числе,&nbsp;</span>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">связанных с религиозными обрядами, о художественных, археологических, культурных, природных, и иных объектах, связанных с путешествием и личными интересами Заказчика;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.3.2. на возмещение в порядке, установленном законодательством убытков и компенсацию морального вреда, причиненных по вине Исполнителя, в случае несоответствия туристического </span></div>\n</div>\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\"><span lang=\"BE\" style=\"line-height: 115%; letter-spacing: -0.2pt;\">6.1.1.Исполнение исполнителем обязательств по настоящему <span style=\"mso-spacerun: yes;\">&nbsp;</span>договору <span style=\"mso-spacerun: yes;\">&nbsp;</span>обеспечивается <span style=\"mso-spacerun: yes;\">&nbsp;</span>посредством </span><span lang=\"BE\" style=\"line-height: 115%; letter-spacing: -0.2pt;\">участия в формировании фонда ответственности туроператоров (РСТИ)</span></span></div>\n</div>\n</div>\n</div>\n</div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">6.2.Исполнитель несет ответственность за неисполнение или ненадлежащее исполнение условий настоящего договора третьими лицами, предоставляющими услуги, составляющие туристский продукт.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">6.3.В случае, если законодательством страны временного пребывания установлены требования по представлению гарантий оплаты медицинской помощи, Исполнитель несет ответственность за не обеспечение Заказчика такими гарантиями. Страховой полис должен предусматривать оплату медицинской помощи туристу и возмещение его расходов при наступлении страхового случая непосредственно в стране (месте) временного пребывания, где это возможно. Страховой полис должен предусматривать оплату медицинской помощи туристу и возмещение его расходов при наступлении страхового случая непосредственно в стране (месте) временного пребывания, где это возможно. Страховой полис или его копия, заверенная в установленном порядке, выдается туристу до его выезда в страну.</span></div>\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7 ОБСТОЯТЕЛЬСТВА, ИСКЛЮЧАЮЩИЕ ОТВЕТСТВЕННОСТЬ СТОРОН.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.1. Стороны освобождаются от ответственности за неисполнение или ненадлежащее исполнение обязательств по настоящему договору, если такое неисполнение или ненадлежащее исполнение явилось следствием обстоятельств, наступление которых стороны не предвидели и не могли предвидеть.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2. Исполнитель не несет ответственности:</span></div>\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.1 за опоздание Заказчика к месту отправления транспортного средства;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.2. в случае отказа в выезде (въезде) Заказчику или другим лицам по настоящему договору пограничными или таможенными органами Республики Беларусь иностранных государств по причинам, не зависящим от Исполнителя. Заказчик обязан оплатить все расходы, возникшие у Исполнителя в связи с таким отказом.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.3 за задержку рейса во время путешествия ( поломка транспортных средств , задержку или отмену автобусных и авиарейсов, и т.д.);</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.4. за задержку транспортного средства при переходе государственной границы, таможни;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.5. за утерю Заказчиком документов, багажа и иного личного имущества. В случае утери (хищения) паспорта Заказчиком или иных документов, затрудняющих или делающих невозможным продолжение путешествия Заказчиком, последний обязан незамедлительно обратиться в компетентные органы страны временного пребывания;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.6. в случае хищения личного имущества Заказчика в номерах, кафе, на территории гостиницы (пансионата).</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.7 в случае хищения личного имущества Заказчика из транспортного средства, предоставленного Исполнителем, если Заказчик не предоставил в письменной форме перечень имеющегося в его багаже имущества руководителю группы под роспись.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.8 за состояние инженерного, сантехнического и прочего оборудования, находящегося в номере, в случае, если Заказчик не поставил в известность о неисправностях администрацию гостиницы (пансионата) в момент заселения в номер.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.9 за неблагоприятные климатические условия в период отдыха Заказчика в стране (месте) временного пребывания;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.10. за документы, оформленные Заказчиком ненадлежащим образом</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.11. Исполнитель не несёт ответственность за вид из окна (если это не являлось одним из условий договора, приложения, путёвки.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7.2.12.если в непосредственной близости от отеля (пансионата, места проживания) могут вестись строительные, инженерные работы, возводиться коммуникации и оборудование, могут располагаться магазины, рестораны, дискотеки, автостоянки, другие организации, осветительные мачты, могут проходить пешеходные, автомобильные, железные дороги и т.д.. В результате чего возможно возникновение нежелательных шумовых, визуальных эффектов, запахов, вибраций и т.д. Поскольку указанные явления находятся вне сферы влияния Исполнителя.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8 СРОК ДЕЙСТВИЯ ДОГОВОРА, ПОРЯДОК ИЗМЕНЕНИЯ И РАСТОРЖЕНИЯ ДОГОВОРА</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8.1.Договор вступает в силу с момента его подписания сторонами, а относительно условий, предусмотренных п. п. 3.3.1.и 3.4.1 до его подписания, и действует до полного исполнения обязательств по договору.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8.2.Все изменения и дополнения настоящего договора, а также соглашение о расторжении настоящего договора совершаются в письменном виде</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8.3.Каждая из сторон вправе потребовать изменения или расторжения договора в связи с существенными изменениями обстоятельств, из которых стороны исходили при заключении договора. К существенным изменениям обстоятельств относятся:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">- со стороны Исполнителя</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">- изменение сроков совершения путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">- недобор указанного в договоре минимального числа туристов в группе, необходимого для совершения путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">- со стороны Заказчика и Исполнителя -непредвиденный рост транспортных тарифов;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">- введение новых или повышение действующих ставок налогов и сборов.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8.4.Договор составлен в двух экземплярах, каждый из которых имеет одинаковую силу.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">9 РАССМОТРЕНИЕ СПОРОВ</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">9.1.Все споры по настоящему договору разрешаются в порядке, предусмотренном законодательством Республики Беларусь.</span></div>\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1; text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">9.2.Стороны устанавливают обязательность предварительного претензионного порядка. Заказчик до обращения за принудительным разрешением спора обязан предъявить претензию в письменной форме Исполнителю по возвращении из путешествия в течение трех рабочих дней с момента его прибытия в Республику Беларусь. Заказчик в обоснование своей претензии обязан представить документы и иные материалы, подтверждающие изложенные в ней факты.</span></div>\n<div style=\"line-height: 1;\">\n<div style=\"text-align: center; line-height: 1;\">\n<table style=\"border-collapse: collapse; width: 100.083%; border-width: 0px;\" border=\"1\"><colgroup><col style=\"width: 49.8339%;\"><col style=\"width: 49.8339%;\"></colgroup>\n<tbody>\n<tr>\n<td style=\"text-align: left; line-height: 1.2; border-width: 0px;\">\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">\"Исполнитель\"</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\"> ОДО &laquo;ИриАнна&raquo;</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">Республика Беларусь г. Минск</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">ул. Сурганова 61, офис 504, р/с BY26AKBB3012014461250300000 </span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">ЦБУ АСБ &laquo;Беларусбанк&raquo;</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">г. Минск, код AKBBBY2X.,</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">УНН 190135143&nbsp; &nbsp;</span><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">тел. (8 10 375 017) 292 04 02</span></span></p>\n<p><span style=\"font-style: italic; font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">подпись &laquo;Исполнителя&raquo;</span><span style=\"font-style: italic; font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\"> __________________________</span></p>\n</td>\n<td style=\"text-align: left; line-height: 1.2; border-width: 0px;\">\n<p><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">\"Заказчик\"</span></span><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">&nbsp;client_name </span></span><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">паспорт passport_number</span></span><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">телефон main_phone</span></span><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">доп.</span></span><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 10pt; color: rgb(33, 37, 41);\">&nbsp;телефон second_phone</span></span></p>\n<p><span style=\"font-weight: bold; font-style: italic; font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">подпись &laquo;Заказчика&raquo;</span><span style=\"font-weight: bold; font-style: italic; font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\"> ______________________</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n</div>\n<div style=\"line-height: 1;\">\n<div style=\"text-align: center; line-height: 1;\">&nbsp;</div>\n</div>\n</div>\n</td>\n<td style=\"border-width: 0px; border-color: rgb(0, 0, 0); line-height: 1.1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">продукта качеству и перечню услуг, обусловленных настоящим договором и выявившихся в процессе путешествия, при условии выполнения Заказчиком принятых на себя обязательств по настоящему договору;</span></div>\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.3.3. в случае существенных изменений условий договора Исполнителем без согласия Заказчика, за исключением изменения условий, предусмотренных п. 3.2., по своему выбору потребовать:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-исполнения условий, указанных в договоре (туристском ваучере, путевке);</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-возмещения убытков и компенсации морального вреда, причиненных в результате существенных изменений договора;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">-расторжение договора и возмещения убытков.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.Заказчик обязан:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.1. до заключения сообщить Исполнителю обо всех обстоятельства, которые могут препятствовать организации путешествия, в том числе: об имевшихся у него ранее нарушениях во время пребывания в других государствах, об отказах во въезде в другие государства.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.2. представить документы, сведения о себе, необходимые для оформления путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.3.уважать политический строй, социальное устройство, традиции, религиозные обычаи страны (места) временного пребывания, соблюдать законодательства страны (места) временного пребывания;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.4. соблюдать установленные нормы и правила охраны окружающей среды, памятников истории и культуры страны (места) временного пребывания;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.5. соблюдать правила въезда, выезда и пребывания в стране временного пребывания и транзитного проезда.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.6. соблюдать правила поведения в составе группы во время проезда к месту проведения отдыха. Предусмотренные настоящим пунктом правила поведения разрабатываются Исполнителем и подписываются Заказчиком в момент заключения Настоящего договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.7. соблюдать правила личной безопасности и сохранности личного имущества во время путешествия;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.8. оплатить полную стоимость туристического продукта, в соответствии с условиями настоящего договора;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.9. немедленно с использованием любых средств связи, информировать Исполнителя, в случае если по прибытию к месту отдыха или в ходе его проведения фактически сложившиеся обстоятельства полностью или частично не соответствуют информации, предоставленной в соответствии с п. 3.1.1. договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3.4.10. при условия считаются принятыми и претензии в дальнейшем не принимаются.</span></div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">4.ЦЕНЫ И ПОРЯДОК РАСЧЕТОВ</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">4.1.Стоимость конкретных (отдельных) услуг, входящих в туристский продукт, указывается в туристской путевке и приложение №1 которые является неотъемлемой частью настоящего договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">4.1.1. Стоимость туристского продукта не может быть увеличена за 20 дней до начала путешествия.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">4.1.2.В случае отказа Заказчика от путешествия менее чем за 20 дней последний возмещает исполнителю фактически понесенные им расходы, до 100% от стоимости&nbsp;тура.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">4.1.3. В случае невозможности исполнения настоящего договора по вине Заказчика, последний возмещает Исполнителю фактически понесенные им расходы, так же Заказчику не возвращается стоимость оплаченной туристической услуги, так как эта услуга является информационной&nbsp; и&nbsp; на момент оплаты Заказчиком&nbsp; туристической услуги Исполнителю&nbsp;, услуга считается выполненной&nbsp;в полном объёме&nbsp;и возврату не подлежит.&nbsp;</span></div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5. ОСОБЫЕ УСЛОВИЯ</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1. Исполнитель довел, а Заказчик принял к сведению и согласился, что:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.1. нахождение в нетрезвом состоянии при посадке в транспортное средства, а также распитие спиртных напитков и неадекватное поведение во время пути следования, категорически запрещается и может привести к расторжению договора без возмещения Заказчику расходов на предоставляемые услуги;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.2. время нахождения транспортного средства в пути является ориентировочным и может изменяться в силу объективных обстоятельств (например: задержка при отправлении автобуса, переходе границы, таможни, загруженность автодороги и т.п.);</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.3. время прибытие транспортного средства к месту отдыха может не совпадать с расчетным временем работы пансионата, гостиницы и т.п.;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.4. по прибытию к месту проведения отдыха уполномоченным государственными органами страны пребывания взимается курортный сбор (сумма курортного сбора определяется местными государственными органами).</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.5.время заселения ( выселения) в гостиницы (пансионаты) зависит от времени прибытия (убытия) автобуса,и регламентируется руководителем группы и администрацией гостиницы (пансионата).</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.6. Заказчик, прибывший на автобусе Исполнителя, в гостиницы (пансионаты) уведомлен, о времени ожидания перед заселением (2-3 часа) для уборки номера.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.7. При размещении, номер предоставляется непосредственно администрацией пансионата, гостиницы. В любом из его корпусов, этажей (если иное не прописано в приложении и путёвке, на момент подписания настоящего договора), исходя из наличия свободных номеров на момент заселения Заказчика с соблюдением согласованных сторонами настоящего договора требований, приложений к договору, путёвке.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.8. Исполнитель не предоставляет выбор этажности и вид из окна, гарантирует при размещение только категорию и наполнение номера согласно договора и путёвки.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5.1.9. Количество суток отдыха исчисляется по количеству ночей проведённых на курорте.</span></div>\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\">\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">6 ОТВЕТСТВЕННОСТЬ СТОРОН</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">6.1. За неисполнение или ненадлежащее исполнение обязательств по настоящему договору стороны несут ответственность в соответствии с действующим законодательством Республики Беларусь. Виновная сторона возмещает другой стороне убытки.</span></div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n</div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n<div style=\"line-height: 1;\">&nbsp;</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\"><strong>irianna_logo</strong></span></div>\n<div style=\"text-align: center; line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\"><strong>ПРИЛОЖЕНИЕ №1</strong></span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">к договору от day.month.year г. </span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">Я, client_name, являющийся Заказчиком по договору , подтверждаю, что в рамках настоящего договора:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">1 Стоимость оказания услуг по настоящему договору составляет&nbsp;</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-size: 10pt; font-family: arial, helvetica, sans-serif;\">service_cost_in_BYN BYN (белорусских рублей) + tour_price_in_curr_1 currency_1 + tour_price_in_curr_2 currency_2. <strong>В случае отказа от тура менее чем за 20 суток до выезда -штраф до 100% от стоимости тура (пункт 4.1.2 договора)</strong></span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">Предусмотренные Настоящим договором суммы уплачиваются:</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">service_cost_in_BYN белорусских рублей - на расчетный счет Исполнителя в порядке безналичных расчетов либо в кассу Исполнителя в порядке наличных расчетов. При безналичных расчетах оплата производится в течение 3-х банковских дней с момента подписания Настоящего договора. При наличных расчетах оплата производится непосредственно в момент заключения договора.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">tour_price_in_curr_1 currency_1 + tour_price_in_curr_2 currency_2 - оплачивается Заказчиком непосредственно по месту проведения отдыха,т.е. в country или Исполнителем в порядке безналичных расчётов принимающей стороне.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">2. Ознакомлен с правилами проживания в отелях и общепринятыми нормами поведения в составе группы, мною изучены правила личной безопасности и сохранности личного имущества во время путешествия, правила поведения в транспортных средствах страны (места) временного пребывания, и со мною проведен по ним инструктаж у Исполнителя до начала путешествия (п.3.4.)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">3. Ознакомлен с правилами техники безопасности, пожарной безопасности, санитарии и гигиены, которые обязуюсь выполнять с момента посадки на транспортное средство во время отправления в путешествие, в стране (месте) временного пребывания и до момента приезда из путешествия.</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">4. Мне предоставлены исчерпывающие сведения об особенностях путешествия и проведен соответствующий инструктаж (п. 3.2.1.)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">5. Мне предоставлена информация о правилах поведения, в случае если по прибытию к месту отдыха или в ходе его проведения фактически сложившиеся обстоятельства полностью или частично не соответствуют информации, предоставленной в момент заключения договора (п. 3.4.9.,п.3.4.10. то есть если условие не соответствует, нельзя расселятся, если расселились условия считаются приняты и в дальнейшем претензии не принимаются)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">7. Мне предоставлена информация о том, что в связи с постановлением Министерства транспорта и коммуникации РБ , на территории страны прибывания будет производиться отстой автобуса до 9 часов (на усмотрение транспортной оргонизации).</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">8. Мне предоставлена полная информация с использованием фотографий, буклетов, ПРИЛОЖЕНИЕ №2 или других источников, а также исчерпывающие сведения обо всех условиях проживания и путешествия.(п.3.1.1)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">9. Мне предоставлена информация о необходимости оплаты курортного сбора (п. 5.1.4.)</span></div>\n<div style=\"line-height: 1;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt; color: rgb(33, 37, 41);\">10.Договор страхования на время тура был предложен.</span></div>\n<div style=\"line-height: 1.2;\">&nbsp;</div>\n<div style=\"line-height: 1.2;\"><span style=\"font-family: arial